    -- data
    _data = {
        [1] = {1,"Chapter 1","Pahlawan lahir","img_mline_enter01","Tuanku bersama dengan empat saudara taman persik mengejar Dong Zhuo, mendapatkan Token Hero, bersama dengan Guan Yinping, Zhang Xingcai bersama mengelanai dunia!",},
        [2] = {2,"Chapter 2","Pemberontakan Turban Kuning.","img_mline_enter02","Tuanku bertemu Pasukan Turban Kuning, mengalahkan Zhang Jiao dan Yu Ji, Mendapatkan Token Hero, menggemparkan Tiongkok!",},
        [3] = {3,"Chapter 3","Kerusuhan Luoyang.","img_mline_enter03","Sepuluh kasim mengacaukan istana Negara Han, Tuanku bangkit menenangkan kekacauan, Kaisar Shao sangat berterima kasih, menghadiahkan Token Hero kepada Tuan.",},
        [4] = {4,"Chapter 4","Cao Cao mempersembahkan pedang.","img_mline_enter04","Tuanku, Cao Cao meminjam pedang pusaka untuk membunuh Dong Zuo tapi gagal, Namun, semangat kepahlawanannya meyakinkan Chen Gong, bersedia meninggalkan jabatannya untuk mengikuti. Tuanku dan Cao Cao memerintahkan para Hero dunia untuk bertarung menyerang Dong Zhuo.",},
        [5] = {5,"Chapter 5","Marquis dari segala penjuru.","img_mline_enter05","Tuanku menantang para Marquis, memadamkan kewibawaan dua bersaudara Yuan, selalu menang dalam perang, sangat heroik.",},
        [6] = {6,"Chapter 6","4 pahlawan melawan Lu Bu.","img_mline_enter06","Tuanku bersama Liu Bei, Guan Yu dan Zhang Fei, memenggal Hua Xiong, berperang dengan Lu Bu, menghilangkan bahaya Para Marquis, menjadi terkenal di dunia.",},
        [7] = {7,"Chapter 7","Sun Jian Mendapatkan Stempel Negara.","img_mline_enter01","Tuanku masuk ke Luoyang, berperang dengan Sun Jian Macan Buas Jiangdong, menang terus, menggemparkan dunia.",},
        [8] = {8,"Chapter 8","Melewati sungai menyerang Liu Biao.","img_mline_enter02","Tuanku berkuda memasuki Jingzhou, mengalahkan Liu Biao, menang dari Sun Ce, menggemparkan seluruh wilayah Jingzhou.",},
        [9] = {9,"Chapter 9","Perang Xingyang.","img_mline_enter03","Cao Cao kalah di Xingyang, Untung mendapat bantuan Tuanku. Dong Zhuo demi menghindari bahaya dari Tuanku, lari terburu-buru masuk ke Chang'an.",},
        [10] = {10,"Chapter 10","Paviliun Fengyi","img_mline_enter04","Tuanku membunuh Dong Zhuo, menolong wanita tercantik di dunia Diao Chan, Rakyat Chang'an merayakannya bersama.",},
        [11] = {11,"Chapter 11","Lu Jue menyerang Chang'an.","img_mline_enter05","Tuanku mengirim Li Jue dan Guo Si berperang dengan Ma Chao, orang yang sifatnya sama, dapat menjadi teman akrab.",},
        [12] = {12,"Chapter 12","Jenderal Baima.","img_mline_enter06","Yuan Shao dan Gongsun Zan berebut Yizhou, Tuanku berperang melawan Gongsun Zan Jenderal Baima, sangat bergensi.",},
        [13] = {13,"Chapter 13","Perang Jieqiao","img_mline_enter01","Tuanku membantu Gongsun zan mengalahkan Yuan Shao, menunjukkan kekuatan, tajam tak tertandingi.",},
        [14] = {14,"Chapter 14","Merekrut orang bertalenta Di Yanzhou.","img_mline_enter02","Tuan memasuki Yanzhou, menahan Xun Yu dan Xun You, mengalahkan Dian Wei, Ahli sipil dan militer, terkenal mendunia.",},
        [15] = {15,"Chapter 15","Bencana datang ke Xuzhou.","img_mline_enter03","Demi membalaskan dendam ayahnya, Cao Cao mengirim pasukan ke Xuzhou, Tuanku membujuk Cao Cao, Cao Cao marah dan tetap mengirim pasukan.",},
        [16] = {16,"Chapter 16","Taishi Ci mengirim surat.","img_mline_enter04","Cao Cao menyerang Xuzhou, Tuanku membantu Tao Qian, Kong Rong menjaga kota, bertukar ilmu dengan Taishi Ci, Taisi Ci kalah dengan puas.",},
        [17] = {17,"Chapter 17","Pinjam Zhao Yun","img_mline_enter05","Tuanku mememinjam Zhao Yun dari Gongsun Zan, sedang berduel dengan Zhao Yun, Peluang bagus untuk orang berkemampuan, sangat heroik.",},
        [18] = {18,"Chapter 18","Kerusuhan Puyang.","img_mline_enter06","Cao Cao hampir mati berperang dengan Lu Bu, Tuanku menolong Cao Cao sekali lagi dalam ribuan pasukan, Cao Cao sangat berterima kasih, menarik mundur pasukan dari Xuzhou.",},
        [19] = {19,"Chapter 19","Tiga kali menolak menerima Xuzhou.","img_mline_enter01","Tao Qian Prefektur Xuzhou sakit, menyerahkan jabatannya kepada Liu Bei, Liu Bei menolak tiga kali, terakhir karena bujukan Tuanku menerima Xuzhou.",},
        [20] = {20,"Chapter 20","Menuju timur pulang ke Luoyang.","img_mline_enter02","Tuanku mengalahkan Li Jue dan Guo Si, menangkap Jenderal terkenal Xu Huang, mengantar kaisar Xian Han pulang ke Luoyang. Kaisar Xian sangat berterima kasih kepada Tuanku, mengangkat Tuanku menjadi Jenderal Yangwei, Tuanku tidak mau terikat, hanya menerima jabatan kosong.",},
        [21] = {21,"Chapter 21","Menahan kaisar, memerintahkan para marquis dengan nama kaisar.","img_mline_enter03","Kaisar Xian Han kembali ke Luoyang, Cao Cao menyambut kaisar, dan memindahkan ibukota ke Xuchang. Tuanku mengantar Kaisar ke Xuchang, mengenal Guo Jia di Xuchang, membuat Guo Jia sangat mengaguminya, membutaya menjadi teman akrab.",},
        [22] = {22,"Chapter 22","Strategi Memanah","img_mline_enter04","Yuan Shu mau menyerang Liu Bei, Tuanku bersama dengan Lu Bu menggunakan strategi memanah gambar, untuk menyelamatkan Liu Bei.",},
        [23] = {23,"Chapter 23","Harimau Jianghuai, Yuan Shu.","img_mline_enter05","Lu Bu menguasai Xuzhou, Yuan Shu Harimau Jianghuai menjadi keluarganya karena hal ini, Tuanku menghina Yuan Shu karena perbuatannya, Lu Lingju percaya kepada Tuanku, pasti akan menolak.",},
        [24] = {24,"Chapter 24","Zhang Fei merebut Kuda Lu Bu","img_mline_enter06","Zhang Fei merebut Kuda Lu Bu, membuat marah Lu Bu, Tuanku mengantar Liu Bei mengikuti Cao Cao, Cao Cao mengangkat Liu Bei sebagai Pejabat administrasi Yuzhou, Tuanku tidak berniat menjadi pejabat, benar-benar menakjubkan.",},
        [25] = {25,"Chapter 25","Tirani Sun Ce","img_mline_enter01","Tuanku pergi Jauh ke Jiangdong, membantu Sun Ce mendapatkan kembali bawahan lama, berkenalan dengan Zhang Zhao dan Zhou Yu, terkenal di Jiangdong.",},
        [26] = {26,"Chapter 26","Perang sengit Taishi Ci.","img_mline_enter02","Tuanku berjuang dengan Taishi Ci, berperang dengan Yan Baihu, membantu Sun Ce menenangkan Jiangdong.",},
        [27] = {27,"Chapter 27","Tabib Sakti Hua Tuo.","img_mline_enter03","Tuanku membantu Sun Quan menjaga Xuancheng, Zhou Tai demi menolong Sun Quan terkena beberapa tombak, Tuanku mengundang Tabib Sakti Hua Tuo untuk mengobatinya, membuat Sun Quan dan Zhou Tai sangat berterima kasih.",},
        [28] = {28,"Chapter 28","Xu Chu bergabung kepada Cao Cao.","img_mline_enter04","Tuanku pergi ke wilayah Chen untuk membasmi Residu Turban Kuning, Kebetulan bertemu Xu Chu, Xu Chu sangat berani, Tuanku merekomendasikan Xu Chu kepada Cao Cao, Cao Cao sangat suka, Xu Chu mendapat nama Harimau.",},
        [29] = {29,"Chapter 29","Perang Wancheng.","img_mline_enter05","Tuanku membantu Cao Cao menyerang Wancheng, Zhang Xiu menyerah tanpa perlawanan, tapi karena Nyonya Zou, menyerang Kamp Cao pada malam hari, Dian Wei mati dalam perang, Tuanku berperang dengan Zhang Xiu dan menolong Cao Cao.",},
        [30] = {30,"Chapter 30","Mengalahkan Zhang Xiu.","img_mline_enter06","Tuanku membantu Cao Cao mengalahkan Zhang Xiu, Xiahou Dun dan Yu Jin datang membantu membawa pasukan, Yu Jin tidak takut gosip, Yu Jin membawa pasukan dengan sangat disiplin, Tuanku kagum terhadap Yu Jin, dan menjadi Teman akrab.",},
        [31] = {31,"Chapter 31","Yuan Shu menjadi Kaisar.","img_mline_enter01","Yuan Shu menjadi kaisar di Shouchun, mengkhianati kerabat, membuat dunia marah. Tuanku meminta Cao Cao, Lu Bu, Liu Bei untuk menyerang Yuan Shu, Yuan Shu kalah telak, menggemparkan dunia.",},
        [32] = {32,"Chapter 32","Menguasai dunia.","img_mline_enter02","Tuanku membantu Sun Ce untuk merebut Lujiang, Menyatukan enam wilayah Jiangdong, menggemparkan Dongwu.",},
        [33] = {33,"Chapter 33","Kecantikan Dua Qiao.","img_mline_enter03","Tuanku bertemu Dua Qiao dari Jiangdong, Da Qiao dan Xiao qiao adalah orang yang cantik dan harum seperti bunga, sangat hebat!",},
        [34] = {34,"Chapter 34","Jiangdong sangat makmur.","img_mline_enter04","Tuanku membujuk Sun Ce untuk berpisah dari Yuan Shu, perbuatan terkenal di Jiangdong, Lu Su dan orang talenta Jiangdong lainnya mendengar nama Tuan, semua datang bergabung.",},
        [35] = {35,"Chapter 35","Memotong rambut menggantikan kepala.","img_mline_enter05","Tuanku menyarankan agar Cao Cao menyerang Zhang Xiu terlebih dahulu, kemudian menuju Hebei. Saat menyerang Zhang Xiu kuda Cao Cao terkejut masuk ke ladang gandum, Tuanku menolong Cao Cao dengan potong rambut menggantikan kepala, dengan cerdik menyelesaikan masalah.",},
        [36] = {36,"Chapter 36","Panah & Mata","img_mline_enter06","Lu Bu menyerang Liu Bei, Cao Cao mengirim Xiahou Dun memimpin pasukan untuk membantu. Xiahou Dun bertemu dengan pasukan Gao Shun, mata kirinya terkena panah, Tuanku dengan cepat menolong Xiahou Dun, Xiahou Dun sangat berterima kasih, meninggalkan kiasan mengambil mata dari panah dan memakannya.",},
        [37] = {37,"Chapter 37","Air membanjiri Xiapi.","img_mline_enter01","Lu Bu kehilangan Xuzhou, hanya tinggal Xiapi. Tuanku membanjiri Xiapi, mengepung Lu Bu, mengalahkan Zhang Liao, hati rakyat Xiapi goyah, Hou Cheng mencuri kuda untuk dipersembahkan.",},
        [38] = {38,"Chapter 38","Menara Gerbang Putih.","img_mline_enter02","Tuanku dan Lu Bu berperang di Menara Baimen, menangkap Lu Bu, terkenal di dunia.",},
        [39] = {39,"Chapter 39","Perang Youzhou.","img_mline_enter03","Tuanku menuju Youzhou untuk menolong Gongsun Zan, Gongsun Zan lebih baik mati demi keadilan, tidak mau hidup tercela, bunuh diri dengan membakar dirinya sendiri. Sangat disayangkan Jenderal tersohor mati begitu saja.",},
        [40] = {40,"Chapter 40","Cao Cao bersama dengan kaisar berburu di Xutian","img_mline_enter04","Liu Bei diangkat menjadi Paman kaisar oleh kaisar, Tuanku berburu bersama kaisar di Xutian, Cao Cao berkuda melangkahi kaisar, ambisinya kelihatan, mengejutkan semua orang.",},
        [41] = {41,"Chapter 41","surat titah dalam baju.","img_mline_enter05","Kaisar Xian Han dengan darahnya menulis wasiat dan menjahitnya dalam bajunya, rahasia ini diberitahu kepada Dong Cheng. Dong Cheng mengundang Tuanku, Liu Bei dan lainnya menyiasati pembasmian Cao Cao.",},
        [42] = {42,"Chapter 42","Membahas Hero saat menghangatkan arak.","img_mline_enter06","Tuanku, Cao Cao dan Liu Bei membahas pahlawan saat menghangatkan arak, sangat membanggakan, Cao Cao takut mendengar nama besar tuanku, dia cemburu.",},
        [43] = {43,"Chapter 43","Liu Bei lolos dari maut.","img_mline_enter01","Liu Bei meminta perintah mencegat Yuan Shu, Cao Cao memerintahkan orang untuk mengejar, Tuanku mengalahkan Xu Chu, mengakali Guo Jia, berhasil membantu Liu Bei melarikan diri.",},
        [44] = {44,"Chapter 44","Kematian Yuan Shu.","img_mline_enter02","Pasukan Yuan Shu menyerang Xuzhou, Tuanku membunuh Ji Ling, mengalahkan Yuan Shu, Yuan Shu kesal dan mati muntah darah, Stempel Negara milik Yuan Shu akhirnya menjadi milik Cao Cao.",},
        [45] = {45,"Chapter 45","Guan Yu memenggal Che Zhou.","img_mline_enter03","Pada saat kejadian surat titah dalam baju, Cao Cao membunuh Ji Ping dan Dong Cheng, Tuanku membantu Liu Bei meninggalkan Cao Cao, membunuh Che Zhou, merebut Xuzhou.",},
        [46] = {46,"Chapter 46","Guan Yu dan Zhang Fei menangkap Wang Can dan Liu Zhen","img_mline_enter04","Tuanku membantu Guan Yu dan Zhang Fei menangkap kedua Jenderal Wang Can dan Liu Zhen, strategi yang luar biasa, membuat orang takjub, Cao Cao sangat marah.",},
        [47] = {47,"Chapter 47","Yuan Shao menantang Cao Cao.","img_mline_enter05","Tuan menggunakan strategi mengepung pasukan Wei untuk menolong Zhao Yun, masuk ke Jizhou membujuk Yuan Shao untuk mengumandangkan perang dengan Cao Cao, awal dari perang Yuan dan Cao.",},
        [48] = {48,"Chapter 48","Jia Xu menyerah kepada Cao Cao.","img_mline_enter06","Tuanku bertemu Jia Xu, mengalahkan Zhang Xiu, Perperangan Yuan Shao dan Cao Cao akan dimulai.",},
        [49] = {49,"Chapter 49","Perang Peixian.","img_mline_enter01","Tuanku membantu Liu Bei menjaga Peixian, melawan Jenderal pasukan Cao, secara beruntun mengalahkan Xiahou Dun, Zhang Liao, membuat Cao Cao panik.",},
        [50] = {50,"Chapter 50","Perang Baima.","img_mline_enter02","Tuanku membantu Guan Yu berperang dengan Pasukan Yuan, secara berurutan memenggal Yan Liang, Wen Chou dua Jenderalnya Yuan Shao, menggemparkan dunia.",},
        [51] = {51,"Chapter 51","Melewati 5 gerbang, menebas 6 Jenderal","img_mline_enter03","Tuan membantu Guan Yu lari dari Kamp Cao, melewati lima gerbang membunuh enam Jenderal, pasukan Cao menjadi ketakutan.",},
        [52] = {52,"Chapter 52","Solo Ribuan Mil","img_mline_enter04","Tuanku berkuda sendirian ribuan mil, berhasil membujuk Zhou Cang, Liao Hua dan Guan Ping, bertukar ilmu dengan Guan Yu, bersaing sengit, Peluang bagus untuk orang berkemampuan.",},
        [53] = {53,"Chapter 53","Bertemu di kota kuno.","img_mline_enter05","Tuanku membantu Guan Yu untuk bergabung bersama Liu Bei, Empat saudara bertemu, Tuanku sangat heroik, menantang Zhao Yun, Zhao Yun mengakuinya.",},
        [54] = {54,"Chapter 54","Memenggal Yu Ji.","img_mline_enter06","Tuan sedang mengunjungi Jiangdong, Membantu Sun Ce membunuh Yu Ji, menggemparkan Jiangdong.",},
        [55] = {55,"Chapter 55","Sun Ce diserang pembunuh.","img_mline_enter01","Sun Ce meninggal dalam penyeranan, Tuanku mempercayakan pada menteri dan Jenderal Jiangdong, agar dapat membantu Sun Quan memimpin Jiangdong, Sun Quan sangat berterima kasih.",},
        [56] = {56,"Chapter 56","Sun Quan merekrut orang bertalenta.","img_mline_enter02","Tuanku bertukar ilmu dengan para menteri dan Jenderal Jiangdong, melawan Lu Su, menang dari Zhou Yu, sangat heroik, membuat kagum semua orang.",},
        [57] = {57,"Chapter 57","Perang Guandu","img_mline_enter03","Perang Guandu, Tuanku menantang pasukan Yuan Shao, awal sampai akhir mengalahkan Shen Pei, Tian Feng, Ju Shou dan Jenderal lainnya.",},
        [58] = {58,"Chapter 58","Membakar Wuchao.","img_mline_enter04","Tuanku membantu Cao Cao membakar Wuchao, mengalahkan Yuan Shao, keduanya melupakan dendam masa lalu, bersama menghadapi Yuan Shao.",},
        [59] = {59,"Chapter 59","Zhang He memberontak.","img_mline_enter05","Tuanku sekali lagi masuk ke pasukan Yuan Shao, membujuk Zhang He agar bergabung dengan Cao Cao, Zhang He tergerak oleh Tuanku, meninggalkan kejelekan menuju kebenaran, mengabdi kepada Tuan yang bijaksana.",},
        [60] = {60,"Chapter 60","Perang Cangting.","img_mline_enter06","Cheng Yu mempersembahkan strategi penyergapan dari segala arah, Tuanku membantu Cao Cao pada perang Cangting untuk mengalahkan Yuan Shao, merayakan bersama Jenderalnya Cao Cao sambil bertukar ilmu, tidak terkalahkan, membuat orang kagum.",},
        [61] = {61,"Chapter 61","Yuan Shao muntah darah.","img_mline_enter01","Tuanku mengalahkan Jenderal besar Shen Pei, menang dari penasihat Pang Ji, berperang dengan Yuan Shang penerus Yuan Shao, terus menang dalam perang, Yuan Shao kaget, muntah darah samapai mati, Yuan Shao dan Yuan Tan melarikan diri, ",},
        [62] = {62,"Chapter 62","Sima Yi berpura-pura sakit.","img_mline_enter02","Saat Cao Cao menjabat sebagai Perdana Menteri, setelah mendengar nama Sima Yi, merekrutnyan untuk bertugas di kediamannya. Sima Yi beralasan dia sakit radang sendi, tidak bisa bangun, menolak Cao Cao. Tuanku sangat penasaran dan datang melihat, Sima Yi kemudian menjelaskan kenyataannya dan sangat mengagumi Tuanku.",},
        [63] = {63,"Chapter 63","Citra Cao Chong.","img_mline_enter03","Sun Quan mempersembahkan seekor gajah untuk negara, Cao Cao ingin tahu berapa berat gajah itu, di bawah petunjuk Tuanku, anak ajaib Cao Chong mendapatkan ide untuk menimbang dengan kapal.",},
        [64] = {64,"Chapter 64","Membanjiri Jizhou.","img_mline_enter04","Tuanku mempersembahkan strategi menggunakan air sungai Zhanghe untuk membanjiri Jizhou, membantu Cao Cao menguasai Jizhou, Xu You karena keangkuhannya, dibunuh oleh Xu Chu.",},
        [65] = {65,"Chapter 65","Menerima Nyonya Zhen.","img_mline_enter05","Tuan membantu Cao Cao menyerang Yecheng, masuk ke kediaman Yuan, menangkap wanita cantik Nyonya Zhen menyukai Cao Zhi, Cao Cao sengaja menjodohkan Nyonya Zhen kepada Cao Pi.",},
        [66] = {66,"Chapter 66","Sebelum kematiannya, Guo Jia menulis strategi untuk menenangkan Liaodong dalam wasiatnya.","img_mline_enter06","Yuan Shang dan Yuan Xi melarikan diri ke Wuheng, Tuanku dan Guo Jia menganjurkan untuk menyerang Liaodong dan pulang dengan kemenangan, kemudian karena kelelahan Guo Jia mati pada umur muda, Tuanku dan Cao Cao sangat sedih.",},
        [67] = {67,"Chapter 67","Paviliun Pipit Tembaga","img_mline_enter01","Tuanku bersama Cao Cao sedang berjalan-jalan ditaman, dari cahaya keemasan muncul Suzaku, Cao Zhi menyarankan membangun Paviliun Pipit Tembaga, Cao Cao sangat senang, ambisinya kelihatan.",},
        [68] = {68,"Chapter 68","Ny. Wen kembali ke Han","img_mline_enter02","Tuanku menerima permintaan Cao Cao, menjemput wanita bertalenta Cai Wenji pulang dari Xiongnu, Cai Wenji sangat berterima kasih kepada Tuanku.",},
        [69] = {69,"Chapter 69","Sima Yi menjadi pejabat.","img_mline_enter03","Cao Cao menghapus tiga jabatan, mengangkat dirinya sendiri sebagai Perdana Menteri, dan merekrut Sima Yi sebagai pejabat, Tuanku dan Sima Yi melakukan percakapan dengan senang, Sima Yi mengagumi Tuannya.",},
        [70] = {70,"Chapter 70","Hua Tuo terkena bencana.","img_mline_enter04","Cao Cao karena sakit kepala mengundang Hua Tuo mengobatinya, Hua Tuo mengusulkan untuk melakukan operasi kepala, Cao Cao curiga Huo Tuo akan mencelekainya, berniat membunuh Hua Tuo, Tuanku membantu Hua tuo melarikan diri, bersembunyi di Jingzhou.",},
        [71] = {71,"Chapter 71","Kuda melangkah melewati Tanxi","img_mline_enter05","Tuanku menuju Jingzhou untuk membantu Liu Bei, Liu Bei merasa sudah berumur tapi mimpi masih belum terwujud, merasa tidak melakukan apa-apa seumur hidup, Tuanku menghibur Liu Bei mengatakan di masa depan pasti berhasil. Liu Bei membujuk Liu Biao menyerang Cao Cao, Liu Biao berniat bertahan, tidak memiliki ambisi besar. Sedang bertemu Nyonya Cai dan Cai Mao berniat membunuh Liu Bei, Tuanku membantu Liu Bei menunggangi Delu, kuda melompat keluar Tanxi, berhasil melarikan diri.",},
        [72] = {72,"Chapter 72","Xu Shu bertemu Tuan yang bijaksana.","img_mline_enter06","Tuanku bertemu dengan Sima Hui Tuan Shuijing, bertukar ilmu beladiri dengan Xu Shu, Tuanku merekomendasikan Xu Shu kepada Liu Bei, mengantar Liu Bei menuju Xinye.",},
        [73] = {73,"Chapter 73","Tiga Kali Kunjungan.","img_mline_enter01","Xu Shu mengajarkan cara memecahkan Formasi Kuncian Delapan Pintu Emas pasukan Cao Ren, Tuanku memimpin pasukan memecahkan formasi dan mengalahkan Cao Ren. Cao Cao membawa pergi Ibu Xu Shu, memaksa Xu Shu meninggalkan Liu Bei dan pergi Ke Kamp Cao, sebelum berangkat, Xu Shu merekomendasikan Zhuge Liang kepaa Liu Bei. Tuanku dan Liu Bei melakukan tiga kali kunjungan, mengundang Zhuge keluar.",},
        [74] = {74,"Chapter 74","Gan Ning bergabung dengan Negara Wu.","img_mline_enter02","Tuanku berjalan jauh ke Jiangdong, membujuk Sun Quan menyerahkan Gan Ning, dan membunuh Huang Zu, sehingga Sun Quan dapat membalas dendam ayahnya. Sun Quan berterima kasih kepada Tuanku.",},
        [75] = {75,"Chapter 75","Mohon melamar Yue Ying.","img_mline_enter03","Tuanku membantu Liu Qi memaksa Zhuge mempersembahkan strategi, Tuan membantu Zhuge untuk menikahi gadis bertalenta Huang Yueying, meninggalkan pujian.",},
        [76] = {76,"Chapter 76","Membakar Lereng Bowang","img_mline_enter04","Pasukan Cao menyerang Xinye, Tuanku menggunakan strategi dari Zhuge Liang, melawan Xiahou Dun satu lawan satu, membakar Lereng Bowang, pasukan Cao melarikan diri kalang kabut.",},
        [77] = {77,"Chapter 77","Cao Cao memenggal Kong Rong.","img_mline_enter05","Xiahou Dun kalah dan pulang ke Xuchang, Cao Cao memimpin pasukan dan mengalahkan Liu Bei, Tuanku pergi membujuk, Cao Cao berkeras kepala, memenggal Kong Rong, setelah hal ini, Tuanku dan Cao Cao menjadi musuh.",},
        [78] = {78,"Chapter 78","Kerusuhan Jingzhou.","img_mline_enter06","Setelah Liu Biao Sakit, Nyonya Cai menulis titah palsu, memerintahkan Liu Cong putra keduanya menjadi penguasa Jingzhou. Liu Cong berniat menyerah kepada Cao Cao, Tuanku memarahi Liu Cong, Cai Mao dan lainnya, pergi menghalangi pasukan Cao Cao.",},
        [79] = {79,"Chapter 79","Membakar Xinye","img_mline_enter01","Liu Bei meninggalkan Xinye, sampai di Fancheng untuk menghindari pasukan Cao. Tuanku meggunakan strategi Zhuge Liang, saat pasukan Cao Ren masuk ke Xinye membuat kamp, menyerang dengan api ketika malam tiba, Cao Ren kalah besar, Tuanku bertemu Jenderal Wei Yan, dan bertukar ilmu, Wei Yan sangat kagum terhadap Tuanku.",},
        [80] = {80,"Chapter 80","Membawa rakyat menyeberangi sungai.","img_mline_enter02","Cao Cao mengirim Yu Jin untuk membunuh Liu Cong dan Nyonya Cai, dan juga mengirim Xu Shu membujuk Tuanku, Xu Shu mengingat hubungan lama, memberitahu Tuanku bahwa pasukan Cao akan tiba, Tuanku bersama dengan Liu Bei berpindah ke Jiangling, berpuluh ribu rakyat rela mengikuti, berjalan bersama Tuanku.",},
        [81] = {81,"Chapter 81","Berkuda Sendirian","img_mline_enter03","Istri Liu Bei terpisah dengan pasukan, Tuanku pergi mencari, kebetulan bertemu Jenderal Zhao Yun yang datang menjemput, berdua bersama menolong A Dou, menyerahkannya pada Liu Bei, Liu Bei sangat mendesah, Demi putra ini, kehilangan adik keempat dan Zhao Yun!.",},
        [82] = {82,"Chapter 82","Membuat gempar Lereng Changban.","img_mline_enter04","Cao Cao menyerang Jingzhou, Tuanku menyelamatkan A Dou dalam keribuatan pasukan, Zhang Fei menjemput di Jembatan Changban wilayah Dangyang. Pasukan Cao melihat Tombak Ular Zhang Fei dan menjadi takut untuk melawan, Sekali Zhang Fei berteriak, menggetarkan air dijembatan dan mengalir terbalik, bisa-bisanya Xiahou Jie Jenderan Cao Cao terkejut, Pasukan Cao langsung rusuh dan melarikan diri.",},
        [83] = {83,"Chapter 83","Berdebat dengan banyak pelajar.","img_mline_enter05","Tuanku dan Zhuge Liang menyeberangi sungai dengan kapal menuju Jiangdong, beraliansi dengan Negara Wu untuk mengalahkan Negara Cao, dipersulit oleh penasihat Negara Dongwu, akhirnya dibalas satu demi satu oleh Zhuge Liang, semuanya terdiam.",},
        [84] = {84,"Chapter 84","Mengesalkan Zhou Yu dengan kecerdasan.","img_mline_enter06","Setelah berdebat dengan banyak pelajar, Tuanku dan Zhuge Liang bertemu Zhou Yu, Zhou Yu berpura-pura beradu mulut dengan Lu Su, Tuanku menggunakan teknik hasutan, mengatakan Cao Cao berniat mendapatkan Xiao Qiao istri Zhou Yu, Zhou Yu marah besar, akhirnya mau beraliansi melawan Cao Cao.",},
        [85] = {85,"Chapter 85","Aliansi Sun Quan dan Liu Bei.","img_mline_enter01","Sun Quan sedikit ragu, Tuanku sengaja bertukar ilmu dengan Zhao Yun dan Guan Yu, dan juga berbicara banyak dengan Zhuge, memamerkan sikap heroik seperti Ahli sipil dan militer, Sun Quan akhirnya memutuskan untuk bersekutu dengan Liu Bei, Bersama-sama melawan Cao Cao.",},
        [86] = {86,"Chapter 86","Jiang Gan terkena Strategi","img_mline_enter02","Tuanku memeriksa Kamp Cao pada malam hari, menemukan Cai Mao, Zhang Yong yang mengerti pasukan air, kemudian digunakan. Tuanku selama ini mengetahui bahwa rasa curiga Cao Cao sangtat berat, memanfaatkan Jiang Gan, menggunakan Strategi balasan, Cao Cao termakan strategi kemudian memenggal Cai Yong dan Zhang Yun.",},
        [87] = {87,"Chapter 87","Meminjam panah dengan kapal jerami.","img_mline_enter03","Aliansi Sun dan Liu kekurangan panah, Zhou Yu menyuruh Zhuge Liang untuk membuat seratus ribu panah. Dengan strategi Zhuge Liang, Tuanku memimpin pasukan menuju Kamp Cao, di bawah perlindungan kabut, kapal rumput meminjam panah, berprestasi besar.",},
        [88] = {88,"Chapter 88","Siasat Melukai Diri Sendiri","img_mline_enter04","Huang Gai menerima perintah untuk berpura-pura menyerah, demi mendapatkan kepercayaan Cao Cao, Zhou Yu sengaja memukulnya dengan keras, membuat Huang Gai berpura-pura marah dan bergabung dengan musuh.",},
        [89] = {89,"Chapter 89","Rantai Besi Berantai","img_mline_enter05","Jiang Gan merekomendasikan Pang Tong kepada Cao Cao, Cao Cao bingung karena tidak ada pengalaman perang air, Pang Tong menyarankan menggunakan rantai berantai, tetapi diketahui oleh Xu Shu, Tuanku, Tuanku menyamar jadi pelayan, mengajari Xu Chu cara melarikan diri.",},
        [90] = {90,"Chapter 90","Rapsodi Cao Cao.","img_mline_enter06","Kapal besar maupun kecil pasukan Cao sudah dihubungkan dengan rantai, sangat stabil, Cao Cao sangat senang, berpuisi Jalan Lagu Pendek, Tuanku dan Pang tong mencuri kesempatan meninggalkan Kamp Cao, kembali ke Jiangdong.",},
        [91] = {91,"Chapter 91","Meminjam angin timur.","img_mline_enter01","Zhou Yu memutuskan menyerang Kamp Cao dengan api, tapi selalu bertiup angin barat laut, Zhou Yu sakit. Zhuge Liang naik ke Paviliun tujuh bintang, meminjam angin timur. Zhou Yu mengirim orang membunuh Zhuge Liang, Tuanku melindungi Zhuge Liang pulang dengan selamat.",},
        [92] = {92,"Chapter 92","Membakar Chibi","img_mline_enter02","Huang Gai pura-pura menyerah pada Cao Cao, berpuluh kapal api menabrak kamp kapal perang Cao Cao dengan meminjam angin tenggara. Tuanku memimpin pasukan untuk membakar Chibi dan sangat merugikan Cao Cao, sejak saat itu Cao Cao, Sun Quan, dan Liu Bei menjadi tiga pihak.",},
        [93] = {93,"Chapter 93","Guan Yu membuat sumpah militer.","img_mline_enter03","Setelah perang Chibi, Di kamp Liu Bei, Penasihat Zhuge Liang mengatur pasukan untuk membasmi sisa pasukan Cao Cao, hanya saja tidak mengirim Guan Yu. Tuanku mencari keadilan untuk Guan Yu, membuat Guan Yu berterima kasih.",},
        [94] = {94,"Chapter 94","Jalan Huarong","img_mline_enter04","Setelah Cao Cao kalah dan melarikan diri saaat perang Chibi, Zhuge Liang mengirim Guan Yu ke Jalur Huarong untuk menyergap. Guan Yu mengingat hubungan lalu, tidak memperdulikan perintah militer, melepaskan Cao Cao, Tuanku mencari Liu Bei untuk memohon pengampunan Guan Yu.",},
        [95] = {95,"Chapter 95","Cao Chong mati karena sakit.","img_mline_enter05","Cao Cao kelihatan menyedihkan, terlihat lemah di depan Tuanku, Tuanku mengingat pertemanan dulu, mengantar Cao Cao pulang ke Xu chang, Cao Chong sakit keras, Tuanku mencari Tabib hebat, tetap saja tidak dapat menyelamatkannya, menyedihkan sekali.",},
        [96] = {96,"Chapter 96","Perang Yiling.","img_mline_enter06","Zhou Yu menuju wilayah selatan menyerang Cao Ren, Tapi belum berhasil. Gan Ning menyerang Yiling yang ada di hulu, mengepung Cao Ren, tapi terkepung oleh pasukan Cao Wei, Tuanku memimpin pasukan untuk menyelamatkan Gan Ning, memukul mundur pasukan musuh.",},
        [97] = {97,"Chapter 97","Zhou Yu berperang melawan Cao Ren.","img_mline_enter01","Cao Ren menantang, Zhou Yu tidak memperdulikan sakitnya, memakai Zirah menunggangi kuda, sengaja jatuh dari kuda di garis depan, mengirimkan berita kematian palsu, membuat Cao Ren terjebak. Tuanku dan pasukan Dongwu bersama mengalahkan Cao Ren, Cao Ren kalah dan lari ke Xiangyang.",},
        [98] = {98,"Chapter 98","Zhuge Liang membuat kesal Zhou Yu.","img_mline_enter02","Perkiraan Zhuge Liang sangat hebat, membuat Tuanku lebih dahulu mendapatkan simbol pasukan daerah Jiangling sebelum Zhou Yu, menipu pasukan di Jingzhou untuk menolong, merebut Jingzhou dan Xiangyang dari Cao Wei, Zhou Yu marah mendengarnya, luka panah kambuh.",},
        [99] = {99,"Chapter 99","Ma Liang mempersembahkan strategi.","img_mline_enter03","Tuanku merekomendasikan Ma Liang kepada Liu Bei, Ma Liang menyarankan agar mengangkat Liu Qi menjadi sekretariat Jingzhou, untuk menenangkan hati rakyat, kemudian menuju selatan menyerang emapt wilayah yaitu Wuling, Changsha, Guiyang dan Lingling, mengumpulkan uang dan makanan merupakan hal penting.",},
        [100] = {100,"Chapter 100","Dengan kecerdasan merebut Lingling.","img_mline_enter04","Tuanku berperang dengan Xing Daorong, dengan stratergi yang cerdas merebut wilayah Lingling, mendapat prestasi utama, semua Jenderal kagum, Ingin mencoba merebut tiga wilayah lainnya.",},
        [101] = {101,"Chapter 101","Zhao Yun merebut Guiyang dengan strategi.","Paviliun Fengyi","Zhao Yun membuat sumpah militer, bersama Tuanku menuju Guiyang, Zhao Fan menghadapi Zhao Yun dengan strategi wanita canti, Zhao Yun tidak goyah sama sekali; kemudian dengan berpura-pura menyerah melawan Zhao Yun, tapi diketahui oleh Tuanku, akhirnya menguasai Guiyang.",},
        [102] = {102,"Chapter 102","Zhang Fei merebut Wuling.","Menyerang Gerbang","Zhang Fei cemas melihat Zhao Yun dan Tuanku masing-masing berhasil mendapatkan wilayah, sangat panik, juga membuat sumpah militer untuk merebut Wuling, Tuanku dan Xing Cai membantu Zhang Fei diam-diam untuk mendapatkan Wuling dalam sekali serang.",},
        [103] = {103,"Chapter 103","Guan Yu sudah melepaskan Huang Zhong.","Luoyang","Han Xuan Prefektur Changsha, gegabah, mudah membunuh, sangat jahat. Guan Yu berniat menguasai Changsha, memimpin 500 pasukan pedang menyerang, Zhuge Liang khawatir Guan Yu meremehkan musuh, Meminta Tuanku untuk membantu. Tuanku dan Huang Zhong Jenderal di bawah Han Xuan berperang dan menang, Guan Yu melepaskan Huang ZHong menjadi kiasan terkenal.",},
        [104] = {104,"Chapter 104","Menerima Wei Yan yang menyerah.","Xuchang","Han Xuan mencurigai Huang Zhong dan Guan Yu bekerja sama, berniat membunuh Huang Zhong, Wei Yan datang tepat waktu membunuh Han Xuan dan menolong Huang Zhong, bergabung bersama Tuanku. Tuanku mempertemukan Wei Yan bertemu Liu Bei dan Zhuge Liang, Zhuge Liang melihatnya memiliki jiwa pemberontak yang kuat, memberi petunjuk dan berhasil membuat Wei Yan menyerah dan menerimanya.",},
        [105] = {105,"Chapter 105","Liu Bei meminjam Jingzhou.","Istana","Liu Bei mendapatkan 4 wilayah Jingzhou, tapi wilayah selatan masih milik Sun Quan, Tuanku dengan sendiri ke Shouchun, bekerja bersama Lu Su, sangat hebat, meminjamkan wilayah selatan kepada Liu Bei.",},
        [106] = {106,"Chapter 106","Pertama kali perang Hefei.","Gerbang Hulao","Cao Cao kalah di Chibi, tapi pasukannya masih kamp di bagian utara Jingzhou. Sun Quan mengirim Zhou Yu menyerang Cao Ren di Jiangling, mengirim Zhang Zhao menyerang Dangtu wilayah Jiujiang, dan sendiri menyerang Zhang Liao di Hefei, Tuanku berangkat membantu Sun Quan, mengalahkan Zhang Liao.",},
        [107] = {107,"Chapter 107","Taishi Ci terkena jebakan.","Tembok Kota","Zhang Liao mengirimkan surat tantangan, Sun Quan marah dan memimpin pasukan sendiri, tapi Song Qian dibunuh oleh Zhang Liao, Taishi Ci memimpin 5000 pasukan untuk balas dendam, dia bekerja sama dengan teman satu kampungnya untuk menyerang, tapi ketahuan oleh Zhang Liao, Taishi Ci terkena banyak panah, kemudian mati.",},
        [108] = {108,"Chapter 108","Lu Su meminta kembali Jingzhou","Xiangyang","Setelah Liu Qi mati karena sakit, Lu Su mendapat perintah untuk merebut kembali Jingzhou, Tuanku sangat hebat, menyarankan menolong Liu Bei merebut Xichuan, bukan hanya mengembalikan Jingzhou, Lu Su bimbang dan kembali ke Dongwu.",},
        [109] = {109,"Chapter 109","Kuil Ganlu.","Turban Kuning","Nyonya Gan istri Liu Bei mati karena sakit, Zhou Yu mengusulkan Sun dan Liu menikah, Zhuge setuju, diam-diam memberikan 3 kantung Sutera kepada Tuan. Tuanku mengantar Liu Bei sampai ke Dongwu untuk melamar, Sun Quan diam-diam mengatur pembunuh, diketahui oleh Tuanku, mengatasinya dengan cerdik.",},
        [110] = {110,"Chapter 110","Pertemuan pahlawan di lereng Zhuma.","Taman Persik","Liu Bei, Tuanku dan Sun Quan Bersaing secara diam-diam, menebas batu uji di depan aula, mendaki lereng gunung dengan berkuda, belajar beladiri satu sama lain, bertanding teknik berkuda, memandangi gunung dan sungai, penuh kebanggaan.",},
        [111] = {111,"Chapter 111","Jodoh yang baik.","Kediaman Jenderal","Tuanku khawatir Liu Bei dicelakai, membuat strategi agar Negara Wu melindungi Liu Bei. Tuanku membantu Liu Bei agar melewati ujian Sun Shangxiang, akhirnya Liu Bei dan Sun Shangxiang menikah, melewati malam pengantin, masa yang dibanggakan dalam hidup, sangatlah nyaman.",},
        [112] = {112,"Chapter 112","Memberi tanda kepada Nyonya Sun.","Pelataran","Setelah Liu Bei menikah, jatuh dalam kondisi yang buruk, tidak memikirkan Jingzhou, Tuanku membuka kantong sutera kedua dari Zhuge Liang, memperingatkan Liu Bei, memberi tanda kepada Nyonya Sun. Tuanku mengantar Liu Bei pulang ke Jingzhou, mengalahkan para Jenderal Dongwu yang datang menghalang, sangat heroik tak tertandingi.",},
        [113] = {113,"Chapter 113","membuat kesal Zhou Yu dua kali.","Istana","Zhou Yu memimpin pasukan untuk menahan Liu Bei dan Tuanu, Zhuge Liang sudah dari awal mengirim orang untuk menjemput, Tuanku dan Guan Yu, Zhao Yun sedang bertukar ilmu dan mengalahkan pasukan Wu, orang-orang mengatakan :Strategi Zhou Yu sangat hebat, pikirnya mau mendapatkan untung, tapi akhirnya mendapat kerugian ganda. setelah Zhou Yu mendengarnya penyakitnya semakin parah.",},
        [114] = {114,"Chapter 114","Cao Cao mengeluarkan perintah merekrut orang bertalenta.","Xuchang","Cao Cao sejak kalah di Chibi, berniat untuk balas dendam, Tuanku pergi membujuk Cao Cao mengatakan situasi sudah diketahui, jangan mudah menyerang, di bawah saran Tuanku, Cao Cao mengeluarkan Perintah mencari talenta, merekrut talenta dari seluruh dunia.",},
        [115] = {115,"Chapter 115","Pesta di Paviliun Pipit Tembaga.","Tembok Kota","Musim Semi di tahun ke 15 Jian'an, Paviliun Pipit Tembaga selesai dibangun, Cao Cao membuat jamuan di Paviliun Pipit Tembaga, mengundang Tuanu, Tuanku bertukar ilmu dengan para Jenderal Cao Cao, menunjukkan kepahlawanan.",},
        [116] = {116,"Chapter 116","Rapsodi Naik Paviliun","Gerbang","Paviliun Pipit Tembaga Selesai, Cao Cao memerintahkan para hero bersenang-senang berkuda dan memanah, Tuanku memberi saran agar pejabat administrasi mempersembahkan puisi. Di antara banyak orang, Cao Zhi yang pertama memberi puisi, berjudul Rapsodi Naik Paviliun, mulai dari saat itu Cao Cao menaruh harapan tinggi terhadap Cao Zhi.",},
        [117] = {117,"Chapter 117","Cheng Yu mempersembahkan strategi.","Xuzhou","Setelah Sun Quan dan Liu Bei menjalin keluarga, Sun Quan memerintahkan Hua Xin untuk merekomendasikan Liu Bei mejadi Prefektur Jingzhou, Cao Cao kebingungan setelah mendengarnya, Cheng Yu memberikan strategi, merekomendasikan Zhou Yu menjadi Prefektur wilayah selatan, Cheng Pu menjadi Prefektur Jiangxia, mengadu domba Sun Quan dan Liu Bei, Tuanku mendengarnya dan kembali ke Jingzhou untuk mengingatkan Liu Bei.",},
        [118] = {118,"Chapter 118","Tiga kali membuat kesal Zhou Yu.","Xiangyang","Zhou Yu menguasai wilayah selatan, memerintahkan Lu Su menyerang Jingzhou, di permukaan kelihatannya mau merebut Xichuan tapi sebenarnya adalah merebut Jingzhou, strateginya ketahuan oleh Zhuge Liang. Tuanku mengingatkan Zhou Yu, harus benar-benar merebut Xichuan, Cao Cao pasti akan mengambil kesempatan ini, Zhou Yu menghela panjang, luka lama kumat dan mati.",},
        [119] = {119,"Chapter 119","Wolong menangisi Zhou Yu.","Yanzhou","Zhuge Liang pergi ke Dongwu untuk berkabung, Tuanku memimpin pasukan mengantarnya, Zhuge Liang mempersembahkan arak, membaca teks penyembahan : Kematian Zhou Yu; tidak beruntung mati muda; Mendengar berita buruk ini, sangat menyakitkan… persembahan selesai, Zhuge Liang menangis rebah di lantai, air matanya bagai air mancur, membuat Lu Su sangat sedih.",},
        [120] = {120,"Chapter 120","Pang Tong kembali ke Negara Shu","Kamp","Lu Su merekomendasikan Pang Tong kepada Sun Quan, tidak di sangka Sun Quan mengkritik wajah Pang Tong jelek, Tuanku membujuk Pang Tong menuju Jingzhou bergabung dengan Liu Bei, sejak saat itu Zhuge Liang dan Pang Tong mengikuti Liu Bei, Banyak orang bertalenta di Jingzhou, akan maju pesat.",},
        [121] = {121,"Chapter 121","Ma Teng ketemu bahaya.","","Cao Cao berniat menyerang ke selatan, takut Xiliang diserang perampok, oleh karena itu memancing Ma Teng ke ibukota, saat itu Ma Teng menerima surat titah dalam baju Kaisar Xian, setelah tiba di ibukota Huang Kui berencana membunuh Cao Cao, tapi ketahuan karena istri tiri Huang Gui, membuat Ma Teng kena musibah.",},
        [122] = {122,"Chapter 122","Strategi Chen Qun.","","Cao Cao telah membunuh Ma Teng, berniat menyerang ke selatan, tiba-tiba mendengar Liu Bei berniat menyerang Xichuan, Chen Qun menunjukkan strategi membawa pasukan menyerang Negara Dongwu, Liu Bei pasti menolong, strategi ini sudah diketahui Zhuge Liang, Zhuge Liang meminta Tuanku untuk ke Xiliang, bekerja sama dengan Ma chao.",},
        [123] = {123,"Chapter 123","Ma Chao menyerang Chang'an.","","Ma Chao dan Han Sui memimpin pasukan 200 ribu, menyerang Chang'an, Zhong Yao hakim Chang'an melawan musuh dengan pasukan pemanah, Chang'an sangat kokok, tidak dapat dijatuhkan. Tuanku punya ide, memberi strategi hebat, menyerang duluan membantu Ma Chao menjatuhkan Chang'an.",},
        [124] = {124,"Chapter 124","Perang Tongguan","","Cao Cao mengetahui sudah kehilangan Chang'an, tidak berani menyerang ke selatan, Mengirimkan Xu Huang, Cao Hong menggantikan Zhong Yao menjaga Tongguan, tidak boleh maju berperang. Ma Chao memimpin pasukan memarahi Cao Cao, sengaja memancing emosi Cao Hong dan menyerangnya, Tuanku dalam kesempatan ini menyerang, kuasai Tongguan.",},
        [125] = {125,"Chapter 125","Kalah Memalukan","","Cao Cao mengirim pasukan langsung ke Tongguan, Ma Chao kalah dan lari tanpa perlawanan, Ma Chao memimpin ratusan kavaleri untuk menangkap Cao Cao, generasi berikutnya berpuisi :  Kalah di Tongguan dan melarikan diri, Cao Cao panik melepas jubah sutera. Pedang memotong kumis membuat ketakuatan, reputasi Ma Chao mendunia.",},
        [126] = {126,"Chapter 126","Xu Chu dan Ma Chao telah berperang 200 ronde dan belum ada yang menang. Xu Chu terburu-buru, melepas Zirah, tanpa pelindung menunggangii kuda membawa pedang, berperang lagi dengan Ma Chao.","","Xu Chu mengirimkan surat tantangan kepada Ma Chao untuk perang penentuan, mereka berdua sudah berduel ratusan ronde, masih belum ada yang menang. Xu Chu tidak sabar, kembali ke formasi, membuka zirah perang, menyerang dengan sekuat tenaga, tidak memakai baju mengangkat pedang, membalikkan ba dan menunggangii kuda berduel dengan Ma Chao, kedua pasukan terkejut.",},
        [127] = {127,"Chapter 127","Perpecahan Han Sui.","","Cao Cao mengikuti strategi membersihkan buku dari Jia Xu, mengadu domba Ma Chao dan Han Sui, Ma Chao dan Han Shui terkena strategi, saling bunuh, Cao Cao menang dengan mengambil kesempatan, Tuanku menolong Ma Chao disaat yang tepat.",},
        [128] = {128,"Chapter 128","Zhang Lu Kaisar Hanning.","","Berita Cao Cao mengalahkan Xiliang sampai ke Negara Hanzhong, mengejutkan Zhang Lu prefektur Hanning, Zhang Lu berniat merebut Yizhou dan menjadi Kaisar Hanning, setelah Liu Zhang Prefektur Yizhou mendapat info, mengirim Zhang Song ke Xuchang membujuk Cao Cao mengirim pasukan merebut Hanzhong.",},
        [129] = {129,"Chapter 129","Buku Mengde","","Zhang Song tiba di Xuchang, mau memberikan peta Xichuan kepada Cao Cao, terjadi perdebatan antara Yang Xiu dan Zhang Song, Zhang Song malah menghafal Buku Baru Mengde dengan sekali baca, tapi Cao Cao tidak menyukai paras Zhang Song, tidak peduli etika, dan memukulnya keluar.",},
        [130] = {130,"Chapter 130","Zhang Song memberikan Peta Xichuan.","","Zhang song melarikan diri dari Xuchang semalaman, menuju Jingzhou, mendapat perlakuan baik dari Liu Bei dan Tuanku, Zhang Song memberikan peta Xichuan kepada Tuanku, Tuanku pergi ke Yizhou, membujuk Fa Zheng, Meng Da untuk menjadi orang dalam, sebagai persiapan Liu Bei masuk ke Xichuan.",},
        [131] = {131,"Chapter 131","Pang Tong menguasai Xishu.","","Fa Zheng ke Jingzhou untuk membujuk Liu Bei agar memasuki Yizhou, Pang Tong mengusulkan untuk membasmi Liu Zhang saat jamuan, Liu Bei tidak tega, Tuanku menyarankan Liu Bei untuk melawan Zhang Lu di Gerbang Jiameng, Liu Bei yang ragu-ragu akhirya setuju memasuki Yizhou.",},
        [132] = {132,"Chapter 132","Zhao Yun menyeberangi sungai menyelamatkan A Dou.","","Dengar-dengar Liu Bei memasuki, Sun Quan bersiap untuk menahan Liu Bei, dan berbohong ibu suri Negara Wu sakit berat dan menjemput Sun Shangxiang kembali ke Dongwu, Tuanku mengetahui strategi Dongwu, memerintahkan Zhao Yun menyelamatkan A Dou.",},
        [133] = {133,"Chapter 133","Membunuh Xun Yu dengan kotak kosong.","","Cao Cao memohon untuk diangkat menjadi Perdana Menteri Wei, Xun Yu menentang dengan tegas, saat Cao Cao memimpin pasukan ke Jiangnan, Memerintahkan Xun Yu untuk ikut, Xun You sakit tinggal di Shouchun. Cao Cao memerintahkan orang memberikan kotak kosong kepada Xun Yu, Xun Yu tahu Cao Cao mau membunuhya, bunuh diri dengan racun.",},
        [134] = {134,"Chapter 134","Anak Idaman","","Tahun ke 18 Jian'an, Cao Cao memimpin 400 ribu pasukan menyerang Gerbang Ruxu Negara Dongwu, Sun Quan memimpin 70 ribu pasukan untuk melawan, Tuanku datang membantu Sun Quan. Cao Cao melihat pasukan Dong Wu sangat disiplin, Sun Quan heroik, Mengeluh Memiliki Putra harus seperti Sun Quan.",},
        [135] = {135,"Chapter 135","Tiga strategi Pang Tong.","","Karena Cao Cao mengganggu Gerbang Ruxi, Liu Bei meminta Tuanku menuju Chengdu memohon pasukan, uang dan makanan, Liu Zhang hanya memberikan pasukan tua dan cacat, Liu Bei marah besar, Pang Tong memberikan 3 Strategi, Tuanku membujuk Liu Bei memilih strategi tengah, masuk merebut Xishu, tidak terhentikan.",},
        [136] = {136,"Chapter 136","Merebut Gerbang Fu.","","Tuanku mengantar Liu Bei pulang ke Fucheng, mengundang Yang Huai dan Gao Pei untuk mengucapkan selamat tinggal, mereka berdua mencoba membunuh Liu Bei, tapi terbunuh oleh Tuanku, Tuanku menggunakan dua orang ini memimpin pasukan membuka jalan menyerang Gerbang Fucheng, pasukan Negara Shu akan menyerah, Tuanku mendapat kemenangan, bersemangat tinggi.",},
        [137] = {137,"Chapter 137","Serang Luocheng.","","Liu Bei merebut Luocheng, Huang Zhong dan Wei yan ingin mendapatkan jasa pertama, Pang Tong memerintahkan dua orang menyerang Ling Bao secara terpisah, di markas pasukan Deng Xian, Wei Yan sangat ingin berjasa, ingin makan sendiri kedua markas itu, akhirnya melarikan diri, untung mendapatkan bantuan Tuanku dan Huang Zhong.",},
        [138] = {138,"Chapter 138","Lereng Luofeng.","","Zhuge Liang mengamati langit, bersurat ke Liu Bei, Tapi Pang Tong salah paham mengira Zhuge ingin merebut jasa perang, berpisah dengan Liu Bei menyerang Luocheng, Liu Bei memberikan Kuda Delu kepada Pang Tong, Pang Tong berkuda melewati Lereng Luofeng, terkena jebakan, tidak beruntung jatuh kebawah.",},
        [139] = {139,"Chapter 139","Menangisi Pang Tong.","","Hari Valentine, Zhuge Liang di Jingzhou, melihat bintang jatuh, menangisi Pang Tong, Liu Bei mengirimkan surat ke Tuanku, meminta bantuan penasihat Zhuge, Zhuge Liang menyerahkan Jingzhou kepada Guan Yu.",},
        [140] = {140,"Chapter 140","Zhang Fei kagum terhadap kesetian Yan Yan dan melepaskannya.","","Zhang Wei memimpin pasukan menyerang Bacheng, Yan Yan Prefektur Bacheng bertahan dan tidak keluar, Zhang Fei menyerang beberapa kali, mundur karena di panah, Tuanku menggunakan strategi, memimpin pasukan berpencar ke empat penjuru menebang pohon mencari jalan, menjebak dan menangkap Yan Yan, menguasai Bacheng.",},
