        [241] = {2001,"","Legenda Diao Chan","0","Diao Chan, salah satu dari 4 Wanita cantik, memiliki kecantikan tiada tandingan dan bagai bulan, memiliki kecantikan yang dapat meruntuhkan negara. Demi membalas budi kepada Wang Yun ayah angkatnya, rela mengorbankan tubuhnya untuk menjalankan strategi membunuh Dong Zhuo.",},
        [242] = {2002,"","Legenda He Jin","0","He Jin, nama kehormatan Suigao, adiknya adalah ratu kesayangan Kaisar Ling Negara Donghan, ketika pemberontakan Turban Kuning, He Jin menjadi Jenderal, menjaga ibukota.",},
        [243] = {2003,"","Legenda Hua Xiong","1","Hua Xiong, salah satu Hero pemberani Dong Zhuo. Pada saat para marquis menyerang Dong Zhuo, dibunuh oleh Guan Yu, Meninggalkan kiasan Memenggal Hua Xiong sebelum arak dingin.",},
        [244] = {2004,"","Legenda Xun Yu","0","Xun Yu, nama kehormatan Wenruo, tampan dan anggun, memiliki talenta menjadi Perdana Menteri, menyusun peta untuk Cao Cao menyatukan wilayah utara, bergelar Xun Lingjun.",},
        [245] = {2005,"","Legenda Zhang Jiao","0","Zhang Jiao, pemimpin Turban Kuning, pencipta ajaran kedamaian, menyebut dirinya Jenderal Langit, memimpin semuanya melancarkan pemberontakan, menyebutnya Pemberontakan Turban Kuning.",},
        [246] = {2006,"","Legenda Sun Jian","2","Sun Jian, nama kehormatan Wentai, Pendiri Negara Dongwu, diberi gelar Macan Jiangdong, jago menggunakan pedang, suka memakai sorban merah, pernah menyerang Turban Kuning dan Dong Zhuo.",},
        [247] = {2007,"","Legenda Taishi Ci","0","Taishi Ci, nama kehormatan Ziyi, hero terkenal Dongwu, jago berkuda dan memanah, teknik memanah hebat, tepat janji, awalnya adalah bawahan Liu Yao, terakhir mengikuti Sun Ce.",},
        [248] = {2008,"","Legenda Da Qiao","0","Da Qiao, wanita cantik masa Tiga Negara, pintar musik dan puisi, kulitnya putih, matanya bagai lukisan, senyumnya bercahaya, sangat memikat orang.",},
        [249] = {2009,"","Legenda Gongsun Zan","3","Gongsun Zan, nama kehormatan Bojia, panglima perang Youzhou. Sangat tampan, cerdas, melawan suku nomaden di utara, pemberani dan jago perang, menggemparkan perbatasan.",},
        [250] = {2010,"","Legenda Jia Xu","0","Jia Xu, nama kehormatan Wenhe, penasihat terkenal, karena memberi strategi kepada Li Jue dan Guo Si menyerang balik Chang'an, maka dipanggil Penasihat beracun. Akhirnya menyerah pada Cao Cao menjadi penasihat Negara Cao Wei.",},
        [251] = {2011,"","Legenda Xu Shu","0","Xu Shu, nama kehormatan Yuanzhi, pernah menjadi pejabat Liu Bei di Xinye, kemudian terpaksa meninggalkan Liu Bei dan mengikuti Cao Cao karena ibunya di tahan oleh Cao Cao, sebelum berangkat merekomendasikan Zhuge Liang kepada Liu Bei.",},
        [252] = {2012,"","Legenda Zhang Xingcai","4","Zhang Xingcai, putri Zhang Fei, menurut legenda pernah menjadi murid Hua Tuo belajar ilmu pengobatan, setelah dewasa menikah dengan Kaisar terakhir Negara Shu yaitu Liu Shan, diangkat menjadi Ratu.",},
        [253] = {2013,"","Legenda Xiahou Yuan","0","Xiahou Yuan, nama kehormatan Miaocai, Salah satu dari 8 Jenderal harimau Negara Cao Wei. Jago memimpin kavaleri perang dari jarak jauh, masuk dan keluar seperti angin, membuat musuh tidak berdaya!",},
        [254] = {2014,"","Legenda Hua Tuo","0","Hua Tuo, nama kehormatan Yuanhua, Tabib Sakti di masa Tiongkok kuno. Ilmu pengobatan hebat, ahli bedah jago operasi, diberi gelar pencetus operasi.",},
        [255] = {2015,"","Legenda Sun Ce","5","Sun Ce, nama kehormatan Bofu, dikenal sebagai Tirani Jiangdong, salah satu pendiri Dongwu, berpenampilan tampan dan anggun, berpikiran terbuka, terkenal, kemudian mengikat saudara dengan Zhou Yu.",},
        [256] = {2016,"","Legenda Yuan Shu","0","Yuan Shu, nama kehormatan Gong Lu, Marquis paling hebat di Huainan. Karena mendapatkan Stempel Negara, menyebut dirinya kaisar, mendapat serangan dari tiga pihak yaitu Sun Ce, Lu Bu dan Cao Cao, kemudian mati muntah darah.",},
        [257] = {2017,"","Legenda Cao Zhi","0","Cao Zhi, nama kehormatan Zijian, penuh kecerdikan, luar biasa, hasil karya yang terkenal (Berkat Dewi Luo)(Artikel Kuda Putih) dan lainnya, Adalah perwakilan Tujuh Cendekiawan Jian'an.",},
        [258] = {2018,"","Legenda Zhu Rong","6","Zhu Rong, menurut legenda adalah keturunan Dewa api Zhu Rong. Seni beladiri luar biasa, jago menggunakan Pisau terbang, istri Kaisar Barbarian Selatan, mengikuti Meng Huo menyerah kepada Negara Shu Han.",},
        [259] = {2019,"","Legenda Kong Rong","0","Kong Rong, nama kehormatan Wenju, ahli sastra pada Negara Han akhir, cucu dari Kong Zi. Sangat pintar dan cerdik pada umur muda, meninggalkan kiasan kasih persaudaraan.",},
        [260] = {2020,"","Legenda Guo Jia","0","Guo Jia, nama kehormatan Fengxiao, Penasihat paling awal di Negara Wei, Salah satu dari 5 penasihat Negara Cao Wei, menjabat penasihat Jijiu. Sangat Cerdas, Banyak strategi.",},
        [261] = {2021,"","Legenda Cao Chong","7","Cao Chong, nama kehormatan Cangshu, Putra Cao Cao. Sejak kecil cerdas dan murah hati, sangat berbeda dengan orang lain, sangat disayangi Cao Cao, meninggalkan kiasan Citra Cao Chong.",},
        [262] = {2022,"","Legenda Dong Zhuo","0","Dong Zhuo, nama kehormatan Zhongying, Panglima perang Liangzhou pada masa akhir Negara Donghan, menjadi pejabat tinggi di Luoyang, menjabat sebagai Guru Agung, sangat berwewenang.",},
        [263] = {2023,"","Legenda Ling Tong","0","Ling Tong, nama kehormatan Gongji, Hero Negara Dongwu, anak Ling Cao. Pernah mengikuti Sun Quan menyerang Jiangxia, lebih duluan sampai di Xiakou, membunuh penyerang Huang Zu, berprestasi tinggi.",},
        [264] = {2024,"","Legenda Yu Ji","8","Yu Ji, Taoist terkenal masa akhir Negara Donghan. Pernah di Wilayah Wu yaitu Kuaiji mengobati rakyat, disukai orang, Sun Ce marah kemudian memenggalnya.",},
        [265] = {2025,"","Legenda Bu Lianshi","0","Bu Lianshi, selir kesayangan Sun Quan, cantik dan lembut, sifatnya baik, bermartabat, murah hati, setelah mati, diangkat menjadi Ratu.",},
        [266] = {2026,"","Legenda Yuan Shao","0","Yuan Shao, nama kehormatan Benchu, Marquis Kuat Hebei pada masa akhir Negara Han. Lahir dari keluarga terhormat, Keluarga Yuan dikenal juga Bergenerasi sebagai pejabat tinggi, tapi dikalahkan Cao Cao saat perang Guandu, kemudian mati karena sakit.",},
        [267] = {2027,"","Legenda Chen Gong","9","Chen Gong, nama kehormatan Gongtai, pernah mengikuti Cao Cao, kemudian menjadi penasihat Lu Bu. Bersifat lurus, cerdas banyak strategi, nasibnya tidak bagus.",},
        [268] = {2028,"","Legenda Yu Jin","0","Yu Jin, nama kehormatan Wenze, salah satu dari 5 Jenderal Hebat Cao Wei. Awalnya adalah Jenderal di bawah Bao Xin, terakhir mengikuti Cao Cao. Menyerah setelah kalah dari Guan Yu, Jenderal Hebat tapi tidak pernah berhasil.",},
        [269] = {2029,"","Legenda Xiahou Dun","0","Xiahou Dun, nama kehormatan Yuanrang, Hero Negara Cao Wei, salah satu dari 8 Jenderal harimau Negara Cao Wei, saudara Xiahou Yuan, meninggalkan kiasan [mencabut panah memakan bola mata]",},
        [270] = {2030,"","Legenda Cai Wenji","10","Cai Yan, dikenal sebagai Nyonya Wen, wanita bertalenta terkenal di Tiga Negara, putri ahli sastra Negara Donghan Cai Yong, berpengetahuan luas, pandai sastra, musik, kaligrafi.",},
        [271] = {2031,"","Legenda Xu Chu","0","Xu Chu, nama kehormatan Zhongkang, Hero Cao Cao. Ketika muda pernah menarik sapi pada ekornya sambil berjalan beratus langkah, membuat mundur perampok.",},
        [272] = {2032,"","Legenda A Dou","0","Liu Shan kaisar terakhir Negara Shu Han, nama kehormatan Gongsi, nama kecil A Dou, Kaisar kedua Negara Shu Han, memiliki karya <Merindukan Negara Shu>.",},
        [273] = {2033,"","Legenda Zhang He","11","Zhang He, nama kehormatan Junyi, salah satu dari 5 Jenderal Hebat Negara Cao Wei. Pernah mengikuti Yuan Shao, Saat perang Guandu bergabung dengan Cao Cao.",},
        [274] = {2034,"","Legenda Huang Gai","0","Huang Gai, nama kehormatan Gongfu, menjadi pejabat di tiga masa yaitu Sun Jian, Sun Ce dan Sun Quan. Sangat ketat, berani dan jago perang, adalah salah satu pahlawan penting saat perang Chibi.",},
        [275] = {2035,"","Legenda Fa Zheng","0","Fa Zheng, nama kehormatan Xiaozhi, Penasihat bawahan Liu Bei. Awalnya adalah bawahan Liu Zhang, membujuk Liu Zhang untuk menyerah, kemudian bersama Liu Bei merebut Hanzhong, memenggal Xiahou Yuan.",},
        [276] = {2036,"","Legenda Lu Su","12","Lu Su, nama kehormatan Zijing, Jenderal Dongwu, pernah menjabat sebagai Gubernur. Penampilannya kekar, kepribadian berani, suka membaca buku, pandai berkuda dan memanah, memiliki banyak harta, sangat setia dan rela membantu orang lain.",},
        [277] = {2037,"","Legenda Pang Tong","0","Pang Tong, nama kehormatan Shiyuan, bergelar Fengchu, penasihat penting Liu Bei, Kecerdasannya setara dengan Zhuge Liang, Dalam Perang Chibi, mempersembahkan strategi Rantai Berantai, membantu Zhou Yu menyerang dengan api mengalahkan Cao Cao.",},
        [278] = {2038,"","Legenda Zhang Zhao","0","Zhang Zhao, nama kehormatan Zi Bu, Pejabat Dongwu. Sebelum kematian Sun Ce, mempercayakan Sun Quan kepada Zhang Zhao dan Zhou Yu, kata-kata terakhir masalah eksternal tanya Zhou Yu, masalah internal tanya Zhang Zhao.",},
        [279] = {2039,"","Legenda Mi Heng","13","Mi Heng, nama kehormatan Zhengping, ahli sastra pada masa akhir Negara Donghan. Saat muda sudah jago sastra dan perdebatan, tapi sifatnya angkuh dan sombong, berhubungan baik dengan Kong Rong.",},
        [280] = {2040,"","Legenda Wen Chou","0","Wen Chou, Jenderal di bawah Yuan Shao, Keberanian tiada tara, cukup terkenal, setelah Yan Liang mati , ingin membalaskan dendam Yan Liang, tapi mati terkejar dan dipenggal oleh Guan Yu.",},
        [281] = {2041,"","Legenda Cai Mao","0","Cai Mao, nama kehormatan Degui, suku terhormat di Jingzhou pada masa akhir Negara Donghan, setelah Liu Biao mati, melindungi Liu Cong meneruskan tahta, kemudian menyerah kepada Cao Cao.",},
        [282] = {2042,"","Legenda Dian Wei","14","Dian Wei, Hero Cao Cao, Bertubuh kekar, bertenaga kuat, mampu mengusir harimau. Jago menggunakan Halberd, pada saat Zhang Xiu berkhianat, mati demi melindungi Cao Cao.",},
        [283] = {2043,"","Legenda Li Jue","0","Li Jue, nama kehormatan Zhiran, Jenderal kesayangan Dong Zhuo, berani dan licik, jago menggunakan pasukan, jago berdebat, memimpin pasukan elit Xiliang yang bernama pasukan beruang terbang.",},
        [284] = {2044,"","Legenda Xiao Qiao","0","Xiao Qiao, istri Zhou Yu, wanita cantik terkenal di Tiga Negara, bersama dengan kakaknya Da Qiao dikenal dengan Jiangdong 2 Qiao.",},
        [285] = {2045,"","Legenda Wang Lang","15","Wang Lang, nama kehormatan Jingxin, Pejabat pada masa Negara Cao Wei, menjabat sebagai Perdana Menteri, master Konfusianisme, berpengetahuan luas, tegas, hemat.",},
        [286] = {2046,"","Legenda Zhang Rang","0","Zhang Rang, Pejabat di akhir masa Negara Han, pemimpin dari sepuluh kasim, sangat brutal, dikenal karena kesombongan dan serakah, Sangat dipercaya oleh Kaisar Ling.",},
        [287] = {2047,"","Legenda Nyonya Zou","0","Nyonya Zou, istri dari Zhang Ji pada masa akhir Negara Han, ipar dari Zhang Xiu. Pada saat Cao Cao perang di Wancheng, Zhang Xiu menyerah tanpa perlawanan; Cao Cao didorong untuk menangkap Nyonya Zou.",},
        [288] = {2048,"","Legenda Yue Jin","16","Yue Jin, nama kehormatan Wen Qian, salah satu dari 5 Jenderal Hebat Negara Cao Wei. Mengikuti Cao Cao karena keberaniannya, mengikuti militer bertahun-tahun, berperang kemana-mana, prestasinya sangat banyak.",},
        [289] = {2049,"","Legenda Li Ru","0","Li Ru, nama kehormatan Wenyou, menantu Dong Zhuo panglima perang pasukan Xiliang pada masa Tiga Negara, kepala penasihat, adalah kepercayaan Dong Zhuo, strateginya hebat tidak pernah salah, dipanggil dengan Zhinang.",},
        [290] = {2050,"","Legenda Lu Lingju","0","Lu Lingju, menurut legenda adalah putri dari Lu Bu dan Diao Chan, cantik tidak kalah dari Diao Chan, Seni beladiri tidak kalah dari ayahnya, sangat anggun, pemberani.",},
        [291] = {2051,"","Legenda Cheng Yu","17","Cheng Yu, nama kehormatan Zhongde, salah satu dari 5 penasihat Negara Cao Wei, Ikut serta dalam penyerangan Lu Bu, Yuan Shao, Liu Bei, dan Sun Quan, selalu mengeluarkan strategi.",},
        [292] = {2052,"","Legenda Gan Ning","0","Gan Ning, nama kehormatan Xingba, Hero Negara Dongwu. Suka berkelana pada usia muda, menancapkan bulu burung dikepalanya, memakai lonceng, memakai pakaian yang indah, berkelana ke seluruh penjuru mencuri harta di kapal, orang memanggilnya Pencuri Jin Fan.",},
        [293] = {2053,"","Legenda Xu Huang","0","Xu Huang, nama kehormatan Gongming, salah satu dai 5 Jenderal pemberani Negara Cao Wei, jago menggunakan Kapak besar, awalnya mengikuti Yang Feng, kemudian mengikuti Cao Cao berperang sari selatan ke utara, banyak prestasi.",},
        [294] = {2054,"","Legenda Ma Yunlu","18","Ma Yunlu, putri Ma Teng, istri Zhao Yun, Adik perempuan Ma Chao. Sifatnya terus terang, belajar seni beladiri dari kecil, teknik tombaknya luar biasa, Pria biasa juga sulit melawannya.",},
        [295] = {2055,"","Legenda Ju Shou","0","Ju Shou, Penasihat di bawah Yuan Shao. Muda berambisi, Jago berstrategi, sering menyarankan strategi yang baik untuk Yuan Shao, tapi sering sekali tidak didengar oleh Yuan Shao.",},
        [296] = {2056,"","Legenda Cao Ren","0","Cao Ren, nama kehormatan Zixiao, Hero terkenal Negara Cao Wei pada masa Tiga Negara, salah satu dari 8 Jenderal pemberani Cao Wei, tegas mengatur pasukan, jago bertahan.",},
        [297] = {2057,"","Legenda Sun Shangxiang","19","Sun Shangxiang, adik wanita Sun Quan, menikah dengan Liu Bei saat perang Chibi. Dia sangat Cantik, Cerdik, berjiwa berontak, tidak kalah dengan Pria.",},
        [298] = {2058,"","Legenda Lu Zhi","0","Lu Zhi, nama kehormatan Zigan, master konfusianisme diakhir Negara Donghan, Jenderal. Berkarakter Kuat, bermoral tinggi, pernah menjabat sebagai Prefektur Jiujiang dan Lujiang.",},
        [299] = {2059,"","Legenda Zhou Tai","0","Zhou Tai, nama kehormatan Youping, Hero Negara Dongwu. Beberapa kali melindungi Sun Quan pada saat perang, Luka diba dan dimana-mana.",},
        [300] = {2060,"","Legenda Zuo Ci","20","Zuo Ci, nama kehormatan Yuanfang, Taoist pada masa akhir Negara Donghan, master lima klasik, astrologi, ramalan kuno, menurut legenda bisa memanggil hantu dan dewa, mendirikan perguruan Danding.",},
        [301] = {2061,"","Legenda Yuan Tan","0","Yuan Tan, nama kehormatan Xiansi, putra sulung Yuan Shao, pernah menghancurkan Tian kai, Kong Rong, Karena Yuan Shao tidak dapat meneruskan tahta, penuh kebencian dalam hatinya, bersama dengan Cao Cao menyerang Yuan Shang.",},
        [302] = {2062,"","Legenda Nyonya Zhen","0","Nyonya Zhen, wanita cantik terkenal di masa Tiga Negara, nama lain Zhen Luo atau Zhen Fu, Ratu Wen Zhaozhen. Berparas cantik, bertalenta, adalah istri utama Cao Pi.",},
        [303] = {2063,"","Legenda Zhuge Jin","21","Zhuge Jin, nama kehormatan Ziyu, Pejabat Negara Wu, Saudara Zhuge Liang, ayah Zhuge Ke. berpikiran luas, sangat jujur, mendapat kepercayaan mendalam Sun Quan.",},
        [304] = {2064,"","Legenda Huang Yueying","0","Huang Yueying, istri Zhuge Liang, putri Huang Chengyan orang terkenal Jingzhou. Menurut legenda, cantik tiada tara tapi pemalu, karena itu menutup wajahnya dengan kerudung.",},
        [305] = {2065,"","Legenda Pan Zhang","0","Pan Zhang, nama kehormatan Wengui, Jenderal Dongwu. pemberani, naik pangkat terus, salah satunya karena menguasai wilayah barat untuk Sun Quan , prestasinya tak terhitung.",},
        [306] = {2066,"","Legenda Sun Quan","22","Sun Quan, nama kehormatan Zhongmou, pendiri Negara Dongwu. Meratakan Jiangdong pada masa muda bersama kakaknya Sun Ce, kemudian Sun Ce mati, Sun Quan meneruskan tahta menjadi penguasa Jiangdong.",},
        [307] = {2067,"","Legenda Yan Liang","0","Yan Liang, Jenderal besar di bawah Yuan Shao, keberaniannya tiada tara, cukup tekenal, bersama Wen Chou dipanggil Dua Pahlawan Hebei.",},
        [308] = {2068,"","Legenda Wang Yi","0","Wang Yi, istri Zhao Ang Sekretariat Yizhou, Zhao Ang bertugas di Jicheng, Wang Yi mengikuti suaminya tinggal di Jicheng.",},
        [309] = {2069,"","Legenda Guan Ping","23","Guan Ping, Hero Negara Shu Han, putra Guan Yu, mengikuti Guan Yu berperang ke timur, sangat pemberani, tidak kalah dengan ayahnya, pernah mengikuti Liu Bei menyerang Xichuan, berpretasi perang.",},
        [310] = {2070,"","Legenda Meng Huo","0","Meng Huo, Kaisar Barbarian Selatan, pemimpin suku kecil di daerah Nanzhong pada masa Tiga Negara, ditangkap dan dilepas 7 kali oleh Zhuge Liang dengan pasukannya, kemudian tidak memberontak lagi.",},
        [311] = {2071,"","Legenda Kaisar Xian Han","0","Kaisar Xian Han, bernama Liu Xie, nama kehormatan Bohe, Kaisar terakhir Negara Donghan. Setelah Dong Zhuo masuk ibukota, menurunkannya Liu Bian kaisar Shao, mengangkat Liu Xie menjadi kaisar.",},
        [312] = {2072,"","Legenda Han Dang","24","Han Dang, nama kehormatan Yigong, Jenderal Dongwu. Jago memanah, berkuda dan kekuatan lengannya luar biasa, mengabdi kepada Sun Jian, Sun Ce dan Sun Quan tiga generasi, memiliki prestasi luar biasa.",},
        [313] = {2073,"","Legenda Zhang Chunhua","0","Zhang Chunhua, istri Sima Yi, ibu Sima Zhao, diangkat menjadi Ratu Xuanmu. Saat muda sangat cerdas, banyak akal.",},
        [314] = {2074,"","Legenda Lu Meng","0","Lu Meng, nama kehormatan Ziming, Hero Negara Dongwu, Prestasipaling terkenal Lu Meng adalah merebut Jingzhou, mengalahkan Guan Yu Hero Negara Shu Han, meninggalkan kiasan Pedagang Palsu.",},
        [315] = {2075,"","Legenda Pang De","25","Pang De, nama kehormatan Lingming, awalnya adalah bawahan Ma Chao, kemudian mengikuti Cao Cao.Dia menunggangi kuda putih yang berlari kencang dan membunuh, sangat perkasa dan berani.",},
        [316] = {2076,"","Legenda Guan Yinping","0","Guan Yinping, putri dari Guan Yu si jenggot indah, memikat, penuh semangat, dalam kecantikan ada sifat heroik, menurut legenda Guan Yinping berguru dengan Zhao Yun.",},
        [317] = {2077,"","Legenda Guan Suo","0","Guan Suo, menurut legenda adalah murid ketiga Guan Yu, menikahi Bao Sanniang, setelah Jingzhou jatuh, membawa Bao Sanniang kembali ke Negara Shu Han, dan mengikuti Zhuge Liang berperang ke selatan.",},
        [318] = {2078,"","Legenda Lu Xun","26","Lu Xun, nama kehormatan, Boyan, Jenderal Dongwu, menjabat sebagai Gubernur, Jenderal utama, Perdana Menteri Negara Wu, Mengalahkan pasukan Shu Han yang dipimpin oleh Liu Bei di Yiling, terkenal dalam sekali perang.",},
        [319] = {2079,"","Legenda Ibu Suri Wu","0","Ibu Suri Wu, istri Sun Jian, Ibu Sun Shangxiang, dalam Romansa Tiga Negara bersama dengan Qiao Guolao menjodohkan Liu Bei dan Sun Shangxiang.",},
        [320] = {2080,"","Legenda Zhang Liao","0","Zhang Liao, nama kehormatan Wenyuan, Hero Lu Bu, terakhir mengikuti Cao Cao, salah satu dari 5 Jenderal pemberani Negara Cao Wei, Pernah memenggal Tadun, menghancurkan Wuheng.",},
        [321] = {2081,"","Legenda Yang Xiu","27","Yang Xiu, nama kehormatan Dezu, ahli sastra pada masa akhir Negara Donghan. Berpengetahuan luas, bertubuh tinggi, pernah menjadi sekretaris di kediaman Perdana Menteri Cao Cao, bahkan Cao Cao mengaguminya.",},
        [322] = {2082,"","Legenda Sima Zhao","0","Sima Zhao, nama kehormatan Zishang, Pejabat tinggi Negara Cao Wei pada masa Tiga Negara, Salah satu pendiri Negara Xijin. Putra kedua Sima Yi dan Zhang Chunhua.",},
        [323] = {2083,"","Legenda Chen Qun","0","Chen Qun, nama kehormatan Zhangwen, Pejabat Penting Negara Cao Wei, pendiri utama sistem Sembilan Tingkat Pejabat dan hukum Hukum Wei Negara Cao Wei.",},
        [324] = {2084,"","Legenda Guan Xing","28","Guan Xing, nama kehormatan Anguo, putra kedua Guan Yu, Hero penting masa akhir Negara Shu Han. Dari kecil dikenal nama baiknya, Zhuge Liang sangat menghargainya.",},
        [325] = {2085,"","Legenda Ma Dai","0","Ma Dai, adik kedua Ma Chao, Hero Negara Shu Han pada masa Tiga Negara, awalnya mengikuti Ma Chao berperang melawan Cao Cao, menyerang balik Longshang, mengepung Chengdu, Perang Hanzhong dan lainnya.",},
        [326] = {2086,"","Legenda Zhou Cang","0","Zhou Cang, nama kehormatan Yuanfu, Pengawal Jenderal Guan Yu Negara Shu Han. bertubuh kekar, berwajah hitam berjenggot gimbal, Awalnya adalah pasukan Turban Kuning, kemudian mengikuti Guan Yu berperang.",},
        [327] = {2087,"","Legenda Gao Shun","29","Gao Shun, Hero Hebat di bawah Lu Bu pada masa akhir Negara Han, menjabat sebagai Kolonel. Sangat Jujur dan tegas, tidak suka minum arak, semua pasukan yang dipimpinnya sangat elit.",},
        [328] = {2088,"","Legenda Liao Hua","0","Liao Hua, nama kehormatan Yuanjian, terkenal karena ketegasan dan keberaniannya, adalah Hero pada masa akhir Negara Shu Han. Menurut legenda awalnya adalah pasukan Turban Kuning, kemudian bergabung dengan Liu Bei, pernah menjadi Sekretraris Guan Yu.",},
        [329] = {2089,"","Legenda Mi Zhu","0","Mi Zhu, nama kehormatan Zizhong, Pejabat di bawah Liu Bei Negara Shu Han. Awalnya adalah pengusaha kaya di Xuzhou, setelah kematian Tao Qian, mendapatkan tugas menjemput Liu Bei.",},
        [330] = {2090,"","Legenda Cao Zhen","30","Cao Zhen, nama kehormatan Zidan , salah satu dari Jenderal harimau Negara Cao Wei, ayahnya di celakai saat menggerakkan pasukan Cao Cao, kemudian diangkat menjadi anak oleh Cao Cao.",},
        [331] = {2091,"","Legenda Xu Sheng","0","Xu Sheng, nama kehormatan Wen Xiang, Jenderal Dongwu, Cerdas dan argumentatif, dia mengambil bagian dalam banyak perperangan.",},
        [332] = {2092,"","Legenda Cheng Pu","0","Cheng Pu, nama kehormatan Demou, Hero Negara Dongwu, melayani Sun Jian, Sun Ce, Sun Quan tiga generasi, orang-orang memberinya gelar [Cheng Gong].",},
        [333] = {2093,"","Legenda Chen Deng","31","Chen Deng, nama kehormatan Yuanlong, ceria, tenang, cemerlang, saat Tao Qian meninggal karena sakit, Chen Deng mendukung Liu Bei menjabat Prefektur Xuzhou.",},
        [334] = {2094,"","Legenda Deng Ai","0","Deng Ai, nama kehormatan Shizai, panglima perang pada masa akhir Negara Wei, Hero. Ahli sipil dan militer, memahami seni perang, lama menjaga perbatasan Negara Wei di barat dari Jiang Wei dari Negara Shu Han.",},
        [335] = {2095,"","Legenda Meng Da","0","Meng Da, nama kehormatan Zidu, orang wilayah Fufeng, Hero Negara Shu Han ada masa Tiga Negara. Awalnya adalah bawahan Liu Zhang, terakhir menyerah kepada Liu Bei.",},
        [336] = {2096,"","Legenda Jiang Gan","32","Jiang Gan, nama kehormatan Ziyi, Pejabat administrasi Negara Cao Wei pada masa akhir Han. Dalam sejarah Jiang Gan adalah orang terkenal pada masa itu, ahli perdebatan.",},
        [337] = {2097,"","Legenda Wang Yun","0","Wang Yun, nama kehormatan Zishi, pejabat tinggi pada masa akhir Negara Donghan. Lahir dari keluarga terhormat, bertalenta, pada saat muda sudah menjadi orang yang bertalenta dan banyak akal, Ahli sipil dan militer.",},
        [338] = {2098,"","Legenda Liu Biao","0","Liu Biao, nama kehormatan Jingsheng, Marquis Jing Zhou pada masa akhir Negara Han. Berwajah sapit, bertubuh kekar, sudah terkenal sejak muda, salah satu dari 8 Tampan.",},
        [339] = {2099,"","Legenda Ding Feng","33","Ding Feng, nama kehormatan Cheng Yuan, Hero masa akhir Negara Dongwu. Saat muda sangat berani pada perang, basmi musuh dengan ganas, banyak prestasi.",},
        [340] = {2100,"","Legenda Lu Kang","0","Lu Kang, nama kehormatan Youjie, putra kedua dari Lu Xun, terkenal sebagai Jenderal terakhir Negara Wu. Pada umur 20 tahun diangkat sebagai Marquis Jiangling.",},
        [341] = {2101,"","Legenda Tian Feng","","Tian Feng, nama kehormatan Yuan Hao, orang dari Julu, penasihat di bawah Yuan Shao saat masa akhir Negara Donghan, menjabat Sekretaris Jizhou.",},
        [342] = {2102,"","Legenda Li Yan","","Li Yan, nama kehormatan Zeng Fang, pejabat Negara Shu Han pada saat Tiga Negara, bersama dengan Zhuge Liang menjadi kepercayaan sebelum Liu Bei mati.",},
        [343] = {2103,"","Legenda Jiang Qin","","Jiang Qin, nama kehormatan Gongyi, Jenderal Dongwu. Awalnya mengikuti Sun Ce menenangkan 4 wilayah, membasmi perampok, pernah dipuji oleh Chen Shou dengan sebutan Harimau Jiangbiao.",},
        [344] = {2104,"","Legenda Pan Feng","","Pan Feng, jago menggunakan kapak, dia mendapat perintah Han Fu menuju Gerbang Hulao untuk menantang bawahan Dong Zhuo yaitu Jenderal Hua Xiong, belum melawan sudah dipenggal.",},
        [345] = {2105,"","Legenda Guo Huai","","Guo Huai, Hero terkenal di masa akhir Negara Wei, pada saat Xiahou Yuan mati dalam perang Guo Huai mengumpulkan sisa pasukan, menstabilkan situasi.",},
        [346] = {2106,"","Legenda Xiahou Ba","","Xiahou Ba, nama kehormatan Zhongquan, Hero penting pada masa akhir Negara Wei dan Shu Han dalam Tiga Negara, putra kedua Xiahou Yuan.",},
        [347] = {2107,"","Legenda Zhong Hui","","Zhong Hui, nama kehormatan Shiji, Hero Negara Wei, putra Zhong Yao guru kaisar, adalah penasihat penting di masa akhir Negara Wei.",},
        [348] = {2108,"","Legenda Cao Ang","","Cao Ang, nama kehormatan Zixiu, putra sulung Cao Cao, rendah hati dan cerdas, sangat disukai Cao Cao.",},
        [349] = {2109,"","Legenda Cao Hong","","Cao Hong, nama kehormatan Zilian, Salah satu dari 8 Jenderal harimau Negara Cao Wei, awalnya mengikuti Cao Cao berperang menyerang Yanzhou, menyerang Liu Biao, mengalahkan Zhu Bi, banyak prestasi.",},
        [350] = {2110,"","Legenda Sima Hui","","Sima Hui, nama kehormatan Dechao, orang terkenal pada masa akhir Negara Donghan, memahami Ajaran Dao, berkuda, perang, Konfusianisme, terkenal dengan nama Tuan Shui Jing.",},
        [351] = {2111,"","Legenda Xun You","","Xun You, nama kehormatan Gong Da, salah satu dari lima penasihat Negara Cao Wei, dipanggil sebagai penasihat utama oleh Cao Cao, strategi perang sangat lincah dan banyak perubahan.",},
        [352] = {2112,"","Legenda Ji Ling","","Ji Ling, nama kehormatan Fuyi, Jenderal di bawah Yuan Shu, sangat berani, Saat menyerang Xuzhou, bertarung dengan Guan Yu 30 ronde, dan belum ada yang menang.",},
        [353] = {2113,"","Legenda Ma Teng","","Ma Teng, nama kehormatan Shoucheng, ayah Ma Chao, Panglima perang wilayah Liangzhou pada masa akhir perpecahan Negara Donghan.",},
        [354] = {2114,"","Legenda Zhang Xiu","","Zhang Xiu, keponakan dari Zhang Ji Jenderal Piaoqi, Panglima perang Wancheng di wilayah perpecahan masa akhir Negara Han.",},
        [355] = {2115,"","Legenda Zhang Liang","","Zhang Liang, salah satu pemimpin pemberontakan Turban Kuning pada masa Negara Donghan, adik ketiga Zhang Jiao, dikenal sebagai [Jenderal Manusia].",},
        [356] = {2116,"","Legenda Ma Su","","Ma Su, nama kehormatan Youchang, adik Ma Liang, Hero Negara Shu Han pada masa tiga kerajaan. Bertalenta, jago strategi perang, Zhuge Liang sangat menghargainya.",},
        [357] = {2117,"","Legenda Ma Liang","","Ma Liang, nama kehormatan Jichang, pejabat Negara Shu Han, kakak Ma Su. Karena ada uban diantara alisnya, orang memanggilnya Alis putih Ma Liang.",},
        [358] = {2118,"","Legenda Nyonya Mi","","Nyonya Mi, Adik perempuan Mi Zhu pejabat tinggi Negara Shu Han, istri Liu Bei.",},
        [359] = {2119,"","Legenda Liu Zhang","","Liu Zhang, nama kehormatan Jiyu, salah satu panglima perang pada masa perpecahan Negara Donghan, meneruskan jabatan ayahnya menjabat prefektur Yizhou.",},
        [360] = {2120,"","Legenda Gu Yong","","Gu Yong, nama kehormatan Yuantan, Pejabat penting Dongwu. Saat kecil berguru kepada Cai Yong, belajar kecapi dan sastra, sangat teliti, tenang dan fokus.",},
    }
}

return story_chapter